// Create IndexedDB 
// https://dev.to/alexeagleson/how-to-use-indexeddb-to-store-data-for-your-web-application-in-the-browser-1o90

const request = indexedDB.open("CarsDatabase", 1);

request.onerror = function (event) {
    console.error("An error occurred with IndexedDB");
    console.error(event);
};

request.onupgradeneeded = function () {
    const db = request.result;
    const store = db.createObjectStore("cars", { keyPath: "id" });
    // createIndex(indexName, keyPath, options) 
    // indexName --> indices.name
    // keyPath --> indices.keyPath
    // options --> { unique: unique, multiEntry: multiEntry }
    store.createIndex("cars_colour", ["colour"], { unique: false });
    store.createIndex("colour_and_make", ["colour", "make"], {
        unique: false,
    });
};

request.onsuccess = function () {
    console.log("Database opened successfully");
    const db = request.result;

    const transaction = db.transaction("cars", "readwrite");

    const store = transaction.objectStore("cars");
    const colourIndex = store.index("cars_colour");
    const makeModelIndex = store.index("colour_and_make");

    store.put({ id: 1, colour: "Red", make: "Toyota" });
    store.put({ id: 2, colour: "Red", make: "Kia" });
    store.put({ id: 3, colour: "Blue", make: "Honda" });
    store.put({ id: 4, colour: "Silver", make: "Subaru" });

    const idQuery = store.get(4);
    const colourQuery = colourIndex.getAll(["Red"]);
    const colourMakeQuery = makeModelIndex.get(["Blue", "Honda"]);

    idQuery.onsuccess = function () {
        console.log('idQuery', idQuery.result);
    };
    colourQuery.onsuccess = function () {
        console.log('colourQuery', colourQuery.result);
    };
    colourMakeQuery.onsuccess = function () {
        console.log('colourMakeQuery', colourMakeQuery.result);
    };

    transaction.oncomplete = function () {
        db.close();
    };
};



navigator.storage.estimate().then((estimate) => {
    const available = estimate?.quota;
    const usedTotal = estimate?.usage;
    const usedCaches = estimate?.usageDetails?.caches;
    const usedIndexedDB = estimate?.usageDetails?.indexedDB;

    console.log("available: ", (available / 1024 / 1024).toFixed(2) + " MB");
    console.log("usedTotal: ", (usedTotal / 1024 / 1024).toFixed(2) + " MB");
    console.log("usedCaches: ", (usedCaches / 1024 / 1024).toFixed(2) + " MB");
    console.log("usedIndexedDB: ", (usedIndexedDB / 1024 / 1024).toFixed(2) + " MB");
});